import React from "react";
import styled from "styled-components";
import Card from "./Card";
const StyledCartList = styled.div`
  display: grid;
  grid-template-columns: repeat(3, 1fr);
  gap: 90px 30px;
  padding: 30px;
`;
const CardList = (props) => {
  return (
    <StyledCartList>
      <Card></Card>
      <Card></Card>
      <Card></Card>
      <Card></Card>
      <Card></Card>
      <Card></Card>
    </StyledCartList>
  );
};

export default CardList;
